        <h2>Front End Skills</h2>
        <p>HTML5, CSS, JQuery, JavaScript, Bootstrap, Materialize, Bulma, React, Handlebars, WordPress and Squarespace</p>
        <h2>Back End Skills</h2>
        <p>Node.js, Express.js, MySQL, Sequelize, MongoDB, GraphQL, and various npms.  </p>
        <p class="lead">
            <a class="btn btn-primary btn-lg" href="#" role="button">Learn more</a>
        </p>

    </div>





  );
};




export default About;
